```
db.medications.aggregate([
  {
    $match: {
      "MEDICATIONS": {
        $elemMatch: {
          "CODE": "NDA020800 0.3 ML Epinephrine 1 MG/ML Auto-Injector"
        }
      }
    }
  },
  {
    $unwind: "$MEDICATIONS"
  },
  {
    $match: {
      "MEDICATIONS.BASE_COST": { $gt: 0 }
    }
  },
  {
    $group: {
      _id: "$MEDICATIONS.CODE",
      successRate: { $divide: [{$count: { $ne: ["$MEDICATIONS.REASON_CODE", 0] }}, {$count: "$MEDICATIONS"}] }
    }
  },
  {
    $match: { _id: "NDA020800 0.3 ML Epinephrine 1 MG/ML Auto-Injector" }
  }
])
```

