```
db.payers.aggregate([
  {
    $match: {
      _id: "d18ef2e6-ef40-324c-be54-34a5ee865625"
    }
  },
  {
    $lookup: {
      from: "payers",
      localField: "NAME",
      foreignField: "NAME",
      as: "covered_patients"
    }
  },
  {
    $unwind: "$covered_patients"
  },
  {
    $lookup: {
      from: "patients",
      localField: "covered_patients.NAME",
      foreignField: "PAYER_ID",
      as: "patients"
    }
  },
  {
    $unwind: "$patients"
  },
  {
    $group: {
      _id: null,
      avg_qol: { $avg: "$patients.QOLS_AVG" }
    }
  }
])
```

```
db.procedures.aggregate([
  {
    $match: {
      'CODE': { $regex: 'Mold' },
      'DESCRIPTION': { $ne: '' }
    }
  },
  {
    $lookup: {
      from: 'patients',
      localField: 'CODE',
      foreignField: 'IMAGING_STUDIES.MODALITY_CODE',
      as: 'procedures'
    }
  },
  {
    $unwind: '$procedures'
  },
  {
    $group: {
      _id: '$procedures.CODE',
      count: { $sum: 1 }
    }
  },
  {
    $sort: { count: -1 }
  },
  {
    $limit: 1
  }
])
```
